import './App.css';
import Header from './components/Header';
import NotesListPage from './pages/NotesListPage';

import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="App">
        <Header/>
        <Route path="/" exact component={NotesListPage}/>
      </div>
    </Router>
  );
}

export default App;
